import React from 'react';
import { motion } from 'framer-motion';
import HeaderLinks from './HeaderLinks';
import Logo from './assets/mgilogo.png';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <motion.nav
      initial={{ y: -250 }}
      animate={{ y: 0 }}
      transition={{ type: 'spring', stiffness: 120 }}
      className="navbar navbar-expand-lg navbar-light fixed-top"
      style={{ backgroundColor: 'transparent', zIndex: 1030 }}
    >
      <div className="container-fluid d-flex justify-content-between align-items-center">
        {/* Removed marginLeft style for logo alignment */}
        <Link to="/" className="navbar-brand d-flex align-items-center">
          <img src={Logo} alt="Logo" style={{ height: '50px', marginRight: '10px' }} />
          <h1 className="mb-0" style={{ fontSize: '1.25rem', margin: '0 auto' }}>My Website</h1>
        </Link>
        {/* Centered navigation links */}
        <div className="d-flex justify-content-end flex-grow-1 pe-3">
          <HeaderLinks />
        </div>
      </div>
    </motion.nav>
  );
}

export default Header;
